let xhr=new XMLHttpRequest;function sendToLog(e){var n=(new Date).getTime();document.querySelector("#node-console").innerHTML+=n+":\n"+e}function showProduct(e){let n=document.querySelector(".products-div"),o="<ul>";for(var t in e=JSON.parse(e))o+="<li><strong>"+t+"</strong>. "+e[t].name+"</li>";o+="</ul>",n.innerHTML=o}xhr.open("GET","http://127.0.0.1:3000"),xhr.onload=function(){sendToLog(this.response),showProduct(this.response)},xhr.send();